bitly.apiJsonc:
{
	"info": {
		"qs": {
			"access_token": "{{connection.accessToken}}"
		},
		"url": "https://api-ssl.bitly.com/v3/user/info",
		"response": {
			"uid": "{{body.id}}",
			"error": {
				"message": "{{if((body.status_txt) == 'MISSING_ARG_ACCESS_TOKEN'; 'OAuth2 connection interrupted. Please try to re-create the connection.';(body.status_txt))}}"
			},
			"valid": "{{if(body.status_code != 500; true; false)}}",
			"metadata": {
				"type": "text",
				"value": "{{body.data.login}}"
			}
		},
		"log": {
        	"sanitize": ["request.qs.access_token"]
    	}
	},
	"token": {
		"url": "https://api-ssl.bitly.com/oauth/access_token",
		"body": {
			"code": "{{temp.code}}",
			"client_id": "{{ifempty(data.clientId, common.clientId)}}",
			"grant_type": "authorization_code",
			"redirect_uri": "{{oauth.redirectUri}}",
			"client_secret": "{{ifempty(data.clientSecret, common.clientSecret)}}"
		},
		"type": "urlencoded",
		"method": "POST",
		"response": {
			"data": {
				"expires": "{{addSeconds(now, body.expires_in)}}",
				"accessToken": "{{body.access_token}}",
				"refreshToken": "{{body.refresh_token}}"
			}
		},
		"log": {
            "sanitize": [
                "request.body.code",
                "request.body.client_secret",
                "response.body.access_token",
                "response.body.refresh_token"
            ]
        }
	},
	"authorize": {
		"qs": {
			"client_id": "{{ifempty(parameters.clientId, common.clientId)}}",
			"redirect_uri": "{{oauth.redirectUri}}",
			"response_type": "code"
		},
		"url": "https://bitly.com/oauth/authorize",
		"response": {
			"temp": {
				"code": "{{query.code}}"
			}
		}
	}
}

baseJsonc:
{
	"qs": {
		"access_token": "{{connection.accessToken}}"
	},
	"baseUrl": "https://api-ssl.bitly.com",
	"response": {
		"error": {
			"message": "{{if((body.status_txt) == 'MISSING_ARG_ACCESS_TOKEN'; 'Invalid connection, please re-create Connection.';(body.status_txt))}}"
		},
		"valid": "{{if(body.status_code != 500; true; false)}}"
	},
	"log": {
        "sanitize": ["request.qs.access_token"]
    }
}
